        FORTNITE_GIFT_INVENTORY_INFO:
          "\xa1Consigue que tu equipo combine con tu {guardOutfitName}!\n\nA partir del 4 de mayo, podr\xe1s desbloquear {rewardName} como Discord Drop si haces una de dos cosas:\n\nTransmite en vivo y comparte la pantalla de Fortnite en Discord durante 15 minutos o m\xe1s a al menos un amigo en Discord.\n\nDespu\xe9s de 15 minutos de compartir pantalla con un amigo, recibir\xe1s un enlace como regalo en tus Ajustes > Inventario de regalos.\n\n\xa1Haz clic en el enlace para iniciar sesi\xf3n en tu cuenta de Epic Games y obtendr\xe1s el Papel en tu casillero de Fortnite!\n\n\xbfNo puedes transmitir? \xa1Tambi\xe9n puedes aceptar la misi\xf3n del bot de Discord! Primero, \xfanete al [servidor oficial de Fortnite en Discord](http://discord.gg/fortnite).\n\nEn el servidor, ver\xe1s un bot con el que puedes interactuar para unirte a la misi\xf3n de Discord.\n\nDespu\xe9s de interactuar con el bot, se te redirigir\xe1 a una p\xe1gina en la que podr\xe1s vincular tus cuentas de Epic y Discord.\n\nUna vez que hayas vinculado tus cuentas, completa una tarea en Discord y otra en Fortnite para participar en la misi\xf3n.\n\n\xa1Una vez que completes ambas tareas, obtendr\xe1s el Papel en tu casillero de Fortnite!\n\n\xa1Aprende m\xe1s en nuestra entrada de blog!\n",
